"help_custom_font_view_intent" : "PowerDirector will open your device's file browser.
Put your True Type fonts (.ttf) in the folder to use them in your titles:
//PowerDirector/fonts/custom/"

"help_custom_font_view_intent" : "端末のファイル ブラウザーを開きます。
True Type のフォント (.ttf) をフォルダーに入れて、タイトル用に使います。
//PowerDirector/fonts/custom/"

"help_custom_font_view_intent" : "PowerDirector öffnet den Dateibrowser Ihres Gerätes.
Platzieren Sie Ihre True Type Fonts (.ttf) in diesem Ordner, damit sie dann in Ihren Titeln verwendet werden:
//PowerDirector/fonts/custom/"

"help_custom_font_view_intent" : "PowerDirector จะเปิดไฟล์เบราว์เซอร์ของอุปกรณ์
ใส่แบบอักษร True Type (.ttf) ในโฟลเดอร์เพื่อใช้ในชื่อเรื่องของคุณ:
//PowerDirector/fonts/custom/"

"help_custom_font_view_intent" : "PowerDirector가 장치의 파일 브라우저를 엽니다.
트루타입 글꼴(.ttf)을 폴더에 저장해 타이틀에 적용하십시오:
//PowerDirector/fonts/custom/"

"help_custom_font_view_intent" : "PowerDirector va ouvrir le navigateur de fichiers de votre appareil.
Mettez vos polices True Type (.ttf) dans le dossier pour les utiliser dans vos titres :
//PowerDirector/fonts/custom/"

"help_custom_font_view_intent" : "PowerDirector abrirá el explorador de archivos del dispositivo.
Ponga sus fuentes True Type (.ttf) en la carpeta para usarlas en los títulos:
//PowerDirector/fonts/custom/"

"help_custom_font_view_intent" : "PowerDirector aprirà il browser di file del tuo dispositivo.
Inserisci i tuoi font True Type (.ttf) nella cartella, per utilizzarli nei titoli:
//PowerDirector/fonts/custom/"

"help_custom_font_view_intent" : "PowerDirector откроет диспетчер файлов на вашем устройстве.
Поместите шрифты True Type (.ttf) в папку, которая будет использоваться для субтитров:
//PowerDirector/fonts/custom/"

"help_custom_font_view_intent" : "威力导演将打开您的设备的文件浏览器。
将您的 True Type 字体 (.ttf) 放在以下文件夹并用于标题：
//PowerDirector/fonts/custom/"

"help_custom_font_view_intent" : "PowerDirector abrirá seu navegador de arquivos de seu aparelho.
Coloque suas fontes True Type (.ttf) na pasta para usá-las em seus títulos:
//PowerDirector/fonts/custom/"

"help_custom_font_view_intent" : "威力導演將會開啟您裝置的檔案瀏覽器。
請將 True Type 字型 (.ttf) 置於下列資料夾以便用於您的文字：
//PowerDirector/fonts/custom/"

"help_custom_font_view_intent" : "威力導演將會開啟您裝置的檔案瀏覽器。
請將 True Type 字型 (.ttf) 置於下列資料夾以便用於您的文字：
//PowerDirector/fonts/custom/"

"help_custom_font_view_intent" : "PowerDirector आपके डिवाइस के फ़ाइल ब्राउज़र को खोलेगा।
अपने शीर्षकों में इस्तेमाल करने के लिए अपने True Type फ़ॉन्ट्स (.ttf) को फ़ोल्डर में डालें:
//PowerDirector/fonts/custom/"

"help_custom_font_view_intent" : "PowerDirector akan membuka browser file perangkat Anda.
Letakkan True Type font (.ttf) anda di folder untuk menggunakannya di judul Anda:
//PowerDirector/fon/kustom/"

"help_custom_font_view_intent" : "PowerDirector akan membuka penyemak imbas fail peranti anda.
Tempatkan fon True Type (.ttf) dalam folder untuk menggunakan fon tersebut dalam titles:
//PowerDirector/fonts/custom/ anda"
